INSERT INTO `feeds` VALUES (1,5,'제가 키위 플랫폼 첫 피드 주인공 입니다! 라임축 가볍고 텍타일이라 특유의 서걱거림이 너무 좋아요! 그리고 제 데스크도 구경하고 가세요!! @>_<@','2025-04-10 07:47:41','2025-04-10 14:39:04',0,4,4,0),(4,1,'갤럭시 사랑해! 안드로이드 사랑해!\n푸릇푸릇한 키보드 Get!','2025-04-10 07:50:07',NULL,0,0,0,0),(5,1,'제 첫 커스텀 키보드입니다 귀엽죠?\n참고로 키캡은 알리에서 업어왔습니다~','2025-04-10 07:56:57',NULL,0,0,0,0),(6,2,'젤리 크리스탈 키캡 2세트 FLEX','2025-04-10 07:57:36','2025-04-10 10:54:28',0,1,1,0),(7,1,'오타는 많이 나지만 귀엽잖아~ 한잔해~\n','2025-04-10 08:10:09',NULL,0,0,0,0),(9,6,'paper80 화이트 입니다! 팜레스트랑 세트이고\nosume 윈터글로우 키캡이랑 조합하였고 \n스위치는 키긱의 블루치즈 스위치를 사용하였어요!!','2025-04-10 08:20:41','2025-04-10 10:53:24',0,0,1,0),(10,1,'사무용 키보드 구매함. \n간만에 회사가는게 기대됨ㅋㅅㅋ','2025-04-10 08:24:11','2025-04-10 13:50:47',0,3,3,1),(11,6,'스웨그키에서 만든 transition lite!! 정말 귀엽고 블링블링하지 않나요?!?! 밤에 불을 끄면 rgb가 반짝반짝 거려서 너무 이뻐요!!','2025-04-10 08:24:52',NULL,0,1,0,1),(12,5,'마산대장님의 키보드를 구경하고 왔어요!! 키캡이 너무 예쁜데 본인도 어디서 샀는지 기억이 안난대여 ㅠㅠㅠ 아시는 분 댓글 달아주세요!!','2025-04-10 08:25:35','2025-04-10 14:17:22',0,1,4,0),(16,3,'거금들여 맞춘 첫 커스텀 키보드입니당...:D\n일어는 하나도 모르지만 간지용 키캡 다들 아시죠?\nPS. 키보드광인 영원한 저희 반 반장이 직접 조립해준 키보드인데여.. 무한 AS가 가능하다고 합니다ㅎㅎ\n(비만다람쥐를 찾는다면 부탁해 보세오)','2025-04-10 08:27:41','2025-04-10 13:59:59',0,3,1,1),(17,4,'싸피에서 사용중인 키보드에요! \n귀엽고 동글동글한 키캡 어떤가요??! 너무 귀엽죠~','2025-04-10 08:31:09',NULL,0,0,0,0),(18,4,'메타몽 키캡이 포인트! 싸피 생활 이 키보드 하나로 만족이라구!! \n오테뮤 저소음 라임축으로 조용한 강의장에서도 조용하게 타자치기 가능하다구!!','2025-04-10 08:42:47',NULL,0,0,0,0),(21,6,'Angry Miao의 RGB65 입니다! 위에 led패널이 있는게 특징이에요!! pgup 키 옆에는 귀여운 여우 아티산이 있고 가격이 좀 나가지만 그만큼 만족스러워요!!','2025-04-10 10:25:37','2025-04-11 06:14:58',0,3,9,3),(22,6,'클래키 빌드로 만든 매그넘65입니다! 실제로 총쏘는듯한 소리가나요!! \n빌드정보 키캡 : GMK Evil Dolch 스위치 : hmx 스노우크래쉬','2025-04-10 10:28:13','2025-04-10 10:55:07',0,1,1,0),(23,6,'qk80 mk2 라는 키보드입니다!! 스위치는 기억이 잘 안나는데.. 클래키 빌드했습니다! 원래 폼떡이 맛도리라는데 저는 클래키로 한번 먹어봐써요!! 이번 키캡은 가성비로 유명한 gmk 블랙스네일!! 이쁘죠!','2025-04-10 10:31:01',NULL,0,0,0,0),(24,4,'스테빌 잡느라 고생한 이번 키보드ㅠㅠ \n귀여운 포켓몬 키캡이 포인트! \n너무 귀엽지 않나용 ㅎㅎ\n','2025-04-10 10:33:10',NULL,0,1,0,1),(25,6,'neo80 이라는 키보드에요! neo는 원래 클래키로 유명하죠!! 그래서 스위치랑 키캡을 abs로 해서 클래키 소리만의 장점을 살렸어요! 키캡정보는 gmk fuji키캡이에요!','2025-04-10 10:33:49',NULL,0,0,0,0),(26,6,'AngryMiao 의 렐릭80이라는 키보드에요~ 사이드에 있는 rgb가 포인트죠! 키캡은 햄웍이라는 pbt키캡을 사용했어요! 그리고 포인트 키캡으로 판다 아티산을 끼워줬어요!','2025-04-10 10:36:15','2025-04-10 14:43:14',0,1,6,2),(27,6,'이번엔 키캡은 아니고 캐나다에 있는 osume사의 키캡이에요! 순서대로 윈터글로우, 츠키미, 윈터글로우이브, 카나가와에요!','2025-04-10 10:37:42','2025-04-10 10:54:11',0,0,1,0),(28,6,'오랜만에 키보드를 바꿔봤어요! 스위치는 유명한 hmx 치즈 스위치를 사용했구 키캡은 오스메 카나가와 키캡을 사용했어요!!','2025-04-10 11:00:14','2025-04-11 01:36:23',0,3,1,2),(29,6,'오늘의 키보드는.. 크러쉬80에 오스메 츠키미!! 아주 귀엽죵?!','2025-04-10 11:01:12','2025-04-10 13:51:23',0,3,1,1),(30,6,'키캡 문의가 정말 많았던 키캡인데.. 이건 바로 TUT사의 야쿠르트! 라는 키캡이에요! 키캡 이름에 알맞게 진짜 야쿠르트같죠?!','2025-04-10 11:03:43','2025-04-10 17:01:04',0,1,2,1),(31,6,'transition lite 알루미늄 상판이랑 알리에서 구매한 메탈 스티커랑 조립해봐써요!','2025-04-10 11:05:02',NULL,0,0,0,0),(33,6,'집에 있는 키보드 전시대에요! 키보드 정보는 핀을 누르면 보여요!','2025-04-10 11:06:57',NULL,0,0,0,0),(34,6,'집에있는 두번째 키보드 전시함이에요!\n스위치 정보 문의가 정말 많았는데 pin을 누르면 보여요!','2025-04-10 11:08:57',NULL,0,0,0,0),(35,6,'TUT 버블티!! 키캡이 아주 귀엽죠?! 포인트 키캡은 직접 그릴수있눈데 제껀 우리반에 있는 어떤 착한 친구가 그려줬어요!','2025-04-10 11:14:57',NULL,0,0,0,0),(36,6,'저희집에 있는 키보드 모음사진!!\n구경하구 가용','2025-04-10 11:16:02','2025-04-10 13:51:03',0,0,1,0),(37,6,'이번엔 키보드는 아니구 유명한 스테빌을 준비해봤어요!\n이퀼즈 철심, 나이트 스테빌, 타입 플러스 스테빌이에요!','2025-04-10 11:18:06',NULL,0,0,0,0),(38,6,'hmx 스위치 들이에요! 보글거리는 소리가 아주 매력적이쥬','2025-04-10 11:19:35',NULL,0,0,0,0),(39,3,'제 예쁜 키보드 보세여','2025-04-10 12:18:21',NULL,1,0,0,0),(40,3,'자랑','2025-04-10 12:27:28',NULL,0,0,0,0),(41,6,'나의 첫 gmk 키캡!! 너무 이뻐요!','2025-04-10 12:56:23',NULL,0,0,0,0),(42,5,'싸월급으로 하나 또 질렀지뭐에요,,, 요번엔 스페이스바는 요즘 핫한 자석축 박았는데 느낌이 오묘하네요 ㅋㅋㅋㅋ 색 다른 기분에 코딩이 즐거워요 또 좋은 자석축 아시는 분 추천해줘요','2025-04-10 13:56:10','2025-04-10 18:18:13',0,3,1,0),(43,4,'새로 구매한 독거미 F87에 오울램 자석축 달아봤어요~~ \n타건감도 너무 좋고, 쫀쫀한게 완전 제스타일!','2025-04-10 14:15:30','2025-04-10 17:04:48',0,1,1,1),(44,2,'crush80 기본 키캡이 좀 별로여서 깔끔한걸로 새로 끼워줬습니다!','2025-04-10 16:48:31',NULL,1,2,0,1),(45,2,'crush80 기본 키캡이 좀 별로여서 깔끔한걸로 새로 끼워줬습니다!','2025-04-10 16:48:45','2025-04-10 17:03:04',0,1,1,1),(46,8,'가방을 사면 키보드 하우징이 사은품으로 온다는 그 유명한 트랜라 입니다!\n투명으로 맞추려고 했는데 품절이라 아쉬운대로 블랙투명으로 했어요...\n트랜라는 탑마운트가 진리인거 같아요! 가스켓 마운트 보다 훨씬 소리가 좋네요. 만족합니다','2025-04-10 16:57:16','2025-04-11 00:20:10',0,2,3,2),(47,1,'키치한 키보드 만들었는데 너무 이쁘지 않나요ㅎ.ㅎ','2025-04-10 23:29:27',NULL,0,0,0,0),(48,4,'키보드 자랑','2025-04-11 00:21:32',NULL,0,1,0,0),(49,4,'키보드 자랑','2025-04-11 01:38:02',NULL,0,1,0,0),(50,4,'잠만보키캡이 포인트!! 너무 귀엽죠?','2025-04-11 07:12:17',NULL,0,0,0,0);
